"original": |2-
     Registries or entries in registries that have been made for RTSP 1.0
     are not moved to RTSP 2.0: the registries and entries of RTSP 1.0 and
     RTSP 2.0 are independent.  If any registry or entry in a registry is
     also required in RTSP 2.0, it MUST follow the procedure defined below
     to allocate the registry or entry in a registry.
"fixed": |-
  Registries or entries in registries that have been made for RTSP 1.0 are not moved to RTSP 2.0: the registries and entries of RTSP 1.0 and RTSP 2.0 are independent.  If any registry or entry in a registry is also required in RTSP 2.0, it MUST follow the procedure defined below to allocate the registry or entry in a registry.
"ko": |-
  RTSP 1.0용으로 만들어진 레지스트리 또는 레지스트리 항목은 RTSP 2.0으로 이동되지 않습니다. RTSP 1.0 및 RTSP 2.0의 레지스트리 및 항목은 독립적입니다. RTSP 2.0에도 레지스트리 또는 레지스트리 항목이 필요한 경우 아래에 정의된 절차를 따라 레지스트리에 레지스트리 또는 항목을 할당해야 합니다.
